import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Nav from './NavBar';
import { fetchRegister } from './Fetch';
import { Box, Stack, TextField, Button, Typography } from '@mui/material';

/**
 *  RegisterForm Component render the register page.
 */
function RegisterForm () {
  const backgroundColor = '#f0f1f2'
  const [email, setEmail] = useState('')
  const [password, setPassword] = useState('')
  const [confirmPassword, setConfirmPassword] = useState('')
  const [name, setName] = useState('')
  const navigate = useNavigate();

  /**
   * Function called when the submit button is clicked.
   * Submit the register info to backend and get the token
   */
  const RegisterSubmit = async (event) => {
    event.preventDefault();
    if (!email.trim() || !password.trim() || !confirmPassword.trim() || !name.trim()) {
      alert('All fields must be filled out');
      return;
    }
    if (password !== confirmPassword) {
      alert('Unmatch password and comfirm password')
    } else {
      try {
        const data = await fetchRegister({ email, password, name })
        if (data.token) {
          localStorage.setItem('TOKEN', data.token)
          navigate('/dashboard');
        } else {
          console.log(data)
        }
      } catch (error) {
        alert(error)
      }
    }
  }
  return (
    <div style={{ backgroundColor, minHeight: '100vh' }}>
      <Nav/>
      <Box
        my={4}
        textAlign="center"
        gap={4}
        p={2}
      >
        <div>
          <Typography variant="h4" sx={{ color: '#888888' }} gutterBottom>
          Create an account
          </Typography>
        </div>
        <form onSubmit={RegisterSubmit}>
          <Stack
            gap={2}
            sx={{
              width: {
                xs: '80vw',
                sm: '60vw',
                md: '30vw',
              },
              height: {
                xs: '70vh',
                sm: '60vh',
                md: '40vh',
              },
              position: 'absolute',
              top: {
                xs: '60%',
                sm: '55%',
                md: '50%',
              },
              left: '50%',
              transform: 'translate(-50%, -50%)',
              backgroundColor: 'white',
              padding: '2%',
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              boxShadow: '3px 3px 3px #abaaaa',
            }}
          >
            <TextField
              label="Email"
              variant="filled"
              sx={{ width: '90%' }}
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
            <TextField
              type="password"
              label="Password"
              variant="filled"
              sx={{ width: '90%' }}
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
            <TextField
              type="password"
              label="Confirm Password"
              variant="filled"
              sx={{ width: '90%' }}
              value={confirmPassword}
              onChange={(e) => setConfirmPassword(e.target.value)}
              required
            />
            <TextField
              label="Name"
              variant="filled"
              sx={{ width: '90%' }}
              value={name}
              onChange={(e) => setName(e.target.value)}
              required
            />
            <Button
              type="submit"
              variant="contained"
              size="large"
              sx={{
                width: '30%',
                backgroundColor: '#2E2E2E',
                color: 'white',
                '&:hover': {
                  backgroundColor: '#464646'
                }
              }}
              onClick={RegisterSubmit}
            >
              Submit
            </Button>
          </Stack>
        </form>
      </Box>
    </div>
  )
}

export default RegisterForm;
